                <div className='form center pa4 br3 shadow-5'>
                    <input className='f4 pa2 w-70 center' type='tex' />
                    <button className='w-30 grow f4 link ph3 pv2 dib white bg-light-blue'>Detect</button>
                </div>
            </div>
        </div>
    );

}

export default ImageLinkForm;
